import {
  FormLabel,
  FormHelperText,
  Box,
  Center
} from '@chakra-ui/react';


function sundaeBox() {
  return(

      <Box bg='#F0FD1F' w='30%' h='500px'  p={4} color = 'white' borderRadius = 'lg' alignItems='center'>

          <Center>
            <FormLabel color='red' >Add Sundae</FormLabel>
          </Center>

          <Center>
            <FormHelperText>Here is some other text</FormHelperText>
          </Center>

      </Box>

  )


}

export default sundaeBox;
